CognitoService.prototype.accessContent = function(cognitoInfo) {
  AWS.config.credentials = new AWS.CognitoIdentityCredentials({
    IdentityPoolId: cognitoInfo.pool_id,
    Logins: {
      '<http://cognito-identity.amazonaws.com|cognito-identity.amazonaws.com>': cognitoInfo.token
    },
    IdentityId: cognitoInfo.identity_id
  });
  AWS.config.region = cognitoInfo.pool_region;

  var path = cognitoInfo.share_path;

  var bucket = new AWS.S3({
    params: {Bucket: cognitoInfo.bucket}
  });
